import XCTest
import AWSSageMakerRuntime

class AWSSageMakerRuntimeTests: XCTestCase {
    
    let WRONG_SAGEMAKER_ENDPOINT = "wrong-endpoint"
    let INPUT_FOR_7 = testImageBufferForValue_7().data(using: .utf8)
    let INCORRECT_INPUT = "123".data(using: .utf8)

    var sageMakerEndpoint: String?
    
    override func setUp() {
        super.setUp()
        AWSTestUtility.setupCognitoCredentialsProvider()
        let credentialsJson = AWSTestUtility.getCredentialsJsonAsDictionary()
        sageMakerEndpoint = credentialsJson?["sageMaker-endpoint"]
    }
    
    func testInvokeAPIWithSucess() {
        let awsSageMaker = AWSSageMakerRuntime.default()
        let sagemkerInvokeInput = AWSSageMakerRuntimeInvokeEndpointInput()!
        sagemkerInvokeInput.body = INPUT_FOR_7
        sagemkerInvokeInput.endpointName = sageMakerEndpoint
        sagemkerInvokeInput.contentType = "text/csv"
        awsSageMaker.invokeEndpoint(sagemkerInvokeInput).continueWith { (task) -> Any? in
            guard let result = task.result else {
                let error =  task.error as NSError?
                XCTFail("Should not produce error: \(error.debugDescription)")
                return nil
            }
            let prediction = String(data: result.body!, encoding: .utf8)
            XCTAssertEqual(prediction, "7.0", "Sagemaker should produce the right result")
            return nil
            }.waitUntilFinished()
    }

    func testInvokeApiWithWrongEndpoint() {
        let awsSageMaker = AWSSageMakerRuntime.default()
        let sagemkerInvokeInput = AWSSageMakerRuntimeInvokeEndpointInput()!
        sagemkerInvokeInput.body = INPUT_FOR_7
        sagemkerInvokeInput.endpointName = WRONG_SAGEMAKER_ENDPOINT
        sagemkerInvokeInput.contentType = "text/csv"
        awsSageMaker.invokeEndpoint(sagemkerInvokeInput).continueWith { (task) -> Any? in
            XCTAssertNotNil(task.error, "Should produce an error for wrong endpoint calls")
            XCTAssertNil(task.result, "Result should be nil for wrong endpoint calls")
            return nil
            }.waitUntilFinished()
    }

    func testInvokeApiWithUnSupportedInput() {
        let awsSageMaker = AWSSageMakerRuntime.default()
        let sagemkerInvokeInput = AWSSageMakerRuntimeInvokeEndpointInput()!
        sagemkerInvokeInput.body = INCORRECT_INPUT
        sagemkerInvokeInput.endpointName = sageMakerEndpoint
        sagemkerInvokeInput.contentType = "text/csv"
        awsSageMaker.invokeEndpoint(sagemkerInvokeInput).continueWith { (task) -> Any? in
            XCTAssertNotNil(task.error, "Should produce an error for unsupported input")
            XCTAssertNil(task.result, "Result should be nil for unsupported input")
            return nil
            }.waitUntilFinished()
    }

    func testInvokeApiWithUnAuthorizedUser() {
        let credentialProvider = AWSStaticCredentialsProvider(
            accessKey: "BAD_KEY_ID",
            secretKey: "BAD_SECRET_KEY")
        let config = AWSServiceConfiguration(
            region: .USEast1,
            credentialsProvider: credentialProvider)
        AWSSageMakerRuntime.register(with: config!, forKey: "Test2")
        let awsSageMaker = AWSSageMakerRuntime.init(forKey: "Test2")
        
        let sagemkerInvokeInput = AWSSageMakerRuntimeInvokeEndpointInput()!
        sagemkerInvokeInput.body = INPUT_FOR_7
        sagemkerInvokeInput.endpointName = sageMakerEndpoint
        sagemkerInvokeInput.contentType = "text/csv"
        awsSageMaker.invokeEndpoint(sagemkerInvokeInput).continueWith { (task) -> Any? in
            XCTAssertNotNil(task.error, "Should produce an error for unauthorized calls")
            XCTAssertNil(task.result, "Result should be nil for unauthorized calls")
            return nil
            }.waitUntilFinished()
    }
    
